from flask import Flask, request, json, render_template, redirect
from datetime import datetime

app = Flask(__name__)

IMAGE = ""
TIME = 1651436603

@app.route("/")
def index():
    return render_template("index.html")

@app.route("/get_my_expensive_nft", methods=["POST"])
def get_nft():
    usr_time = request.form.get("time")

    try:
        usr_time = int(usr_time)
    except ValueError:
        return render_template("index.html", ERROR=",     ")

    if TIME != usr_time:
        ERROR = datetime.fromtimestamp(usr_time / 1000).strftime('<br>   %d.%m.%Y  %H:%M:%S')
        return render_template("index.html", ERROR=",   ,  01.05.2022   23:23:23\n" + ERROR)

    return render_template("expensive_nft.html", image=IMAGE)

if __name__ == "__main__":
    app.run("0.0.0.0", 80)